import React from "react";
import classes from "./LeftUserBoxContainer.module.css"
import LeftUserBox from "./LeftUserBox";

import classimg from '../../../../images/groupImage.png';
import user1Image from '../../../../images/girl1.jpeg'
import user2Image from '../../../../images/User2.jpg'
import user3Image from '../../../../images/user3.jpeg'
import user4Image from '../../../../images/user4.jpg'



import axiosInstance from '../../../axios';




const LeftUserBoxContainer = () =>{



let groupname="Classical Mechanics-I";
let user1="Reena Samant";
let user2="Flower JI";	

let user3="John siha"	

return(

<div className={classes.leftUserBoxContainer}>

<LeftUserBox userImage={classimg} userName={groupname} />

<LeftUserBox userImage={user1Image} userName={user1} />

<LeftUserBox userImage={user2Image} userName={user2}  />

<LeftUserBox userImage={user3Image} userName={user3}  />

<LeftUserBox userImage={user4Image} userName="Bibhuparasd Mahakud" />

<LeftUserBox userImage={user1Image} userName="Ipsit Panda" />

<LeftUserBox userImage={user2Image} userName="Bibuti Parida" />

<LeftUserBox userImage={user3Image} userName="Jai Sriram" />

<LeftUserBox userImage={user4Image} userName="Ganesh kumar Routray" />





</div>

);

}

export default LeftUserBoxContainer;
